css:
/* AGENT_SHEET */
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("engadget.com") {

body {
	background: #333 url("data:image/png;base64,") top left repeat-x !important;
	color: #FFF !important;
	font-family: Tahoma, Arial, Helvetica, sans-serif !important;
}

/* defaults for all links */
a:link { color: #ccc!important; }
a:visited { color: #999!important; }
a:active { color: #fff!important; }
a:hover {background: transparent !important; }

#logo
{
    background: transparent url(http://www.blogsmithmedia.com/www.engadget.com/media/eng-logo.png) no-repeat scroll 0 0 !important; 
}

/* change color of lots of text */
/* changed to a darker color to be visible with 
their new comment page */
/*font, div, td { color: #FFF !important; }*/
font, div, td { color: #CC9933 !important; }

/* make sure web forms (and google suggest) don't get their colors changed */
input *, textarea *, .aAutoComplete { background-color: -moz-Field !important; color: -moz-fieldtext !important; }

#outerslice,
.topleader,
.bottomleader,
#subcontent,
#grid,
.google_units,
iframe,
.sponsored,
div[id^="bp"],
#container + p,
[id="content"] > p,
#network,
#hat,
.inpostad
{
  display: none !important;
}

#wrapper,
#wrapper2 {
	background: transparent !important;
	padding-right: 10px !important;
}

#content, [id="comments"], [class*="commentclass"] {
	background: transparent !important;
	padding-top: 0 !important;
}

#innercontent {
	background: transparent !important;
}

#container {
	background: transparent !important;
	width: 80% !important;
	min-width: 0 !important;
	max-width: none !important;
}


#branding,
#bloginfo,
#innerbloginfo,
#header,
#footer,
#legal,
#footer_right,
#header-inner,
#page,
#hat
{
	background: transparent !important;
	height: 105px !important;
}

.searchform
{
        background: #FFF !important;
        height: 0px !important;
        padding-top: 0px !important;
        position: absolute !important;
        right: 0px !important;
        top: 30% !important 
}

.clearfix, .cobrand {
        display: none !important 
}

#rsslink {
	background: transparent !important;
}

.post, [id="comments"], [id="commentform"], [id="content"]  > ul {
	background: transparent !important;
	font-size: 1.2em !important;
        position: relative !important;
        left: 20% !important
}

[id="cmttabs"] {
       background: transparent !important;
       font-size: 1.2em !important;
       border-top: 1px !important 
}

.post img {
	background: transparent !important;
	border: none !important
}

.postgallery {
	background: transparent !important
}

#branding img[src$="logo.gif"] {
	width: 0 !important;
	height: 80px !important;
	padding-left: 324px !important;
	background-image: url("data:image/png;base64,") !important
}

}
